adas com cuidado e de forma cr\u00edtica."},"id":"46403","type":"Paragraph"},{"attributes":{"text":"\u00d3bitos Novos = 21.0000"},"id":"46399","type":"Paragraph"},{"attributes":{"text":"&lt;select onchange=\"location = this.value;\"&gt;&lt;option&gt;Selecione uma das Op\u00e7\u00f5es a Seguir&lt;/option&gt;&lt;option value=\"NERNRSCA24004.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24004&lt;/option&gt;&lt;option value=\"NERNRSCA24008.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24008&lt;/option&gt;&lt;option value=\"NERNRSCA24003.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24003&lt;/option&gt;&lt;option value=\"NERNRSCA24006.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24006&lt;/option&gt;&lt;option value=\"NERNRSCA24002.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24002&lt;/option&gt;&lt;option value=\"NERNRSCA24001.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24001&lt;/option&gt;&lt;option value=\"NERNRSCA24005.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24005&lt;/option&gt;&lt;option value=\"NERNRSCA24007.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24007&lt;/option&gt;&lt;option value=\"NERNRSOA24004.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24004&lt;/option&gt;&lt;option value=\"NERNRSOA24008.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24008&lt;/option&gt;&lt;option value=\"NERNRSOA24003.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24003&lt;/option&gt;&lt;option value=\"NERNRSOA24006.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24006&lt;/option&gt;&lt;option value=\"NERNRSOA24002.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24002&lt;/option&gt;&lt;option value=\"NERNRSOA24001.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24001&lt;/option&gt;&lt;option value=\"NERNRSOA24005.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24005&lt;/option&gt;&lt;option value=\"NERNRSOA24007.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24007&lt;/option&gt;&lt;option value=\"NEPBRSCA25011.html\"&gt;Regiao de Sa\u00fade: NEPBRSCA25011&lt;/option&gt;&lt;option value=\"NEPBRSCA25007.html\"&gt;Regiao de Sa\u00fade: NEPBRSCA25007&lt;/option&gt;&lt;option value=\
